import PropTypes from 'prop-types';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import React, { useContext } from "react";
import SessionContext from "../../components/session/SessionContext";
import { TextField, InputLabel } from "@material-ui/core";

function TabPanel(props) {


  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

export default function BasicTabs() {
  const [value, setValue] = React.useState(0);
  const {
    session: { user },
    actions: { logout },
  } = useContext(SessionContext);

  const { email, name, lastname, avatar, address, photo, phone } = user;

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  const About=()=>{
    return(
    <div>
  <div class="container emp-profile">
     <form method="post">
     <div class="row">
       <div class="col-md-4"></div>       <div class="col-md-12">
          <div class="profile-head">

           <br />           <br />
            <div class="profile-img">

               <img
                  style={{ maxWidth: 200,maxHeight:200 ,borderRadius:"50%",borderBlockColor:"red"}}
                  src="https://static.remove.bg/remove-bg-web/ad5bb40e8ada6fca658b7a6da9ae4eb718ac2aba/assets/start_remove-c851bdf8d3127a24e2d137a55b1b427378cd17385b01aec6e59d5d4b5f39d2ec.png"
                  alt=""
                />
                <div class="col-md-2">
            <input
              type="submit"
              class="profile-edit-btn"
              name="btnAddMore"
              value="Edit Profile"
            />
            <input
              type="submit"
              class="profile-edit-btn"
              name="btnAddMore"
              value="Logout"
              onClick={logout}
            />
          </div>
              </div>
              <h5 style={{ color: "blue" }}>
                {name} &nbsp;{lastname}
              </h5>
              <h6></h6>
              <p class="proile-rating"></p>
              <ul class="nav nav-tabs" id="myTab" role="tablist">
                <li class="nav-item">
                  <a
                    class="nav-link active"
                    id="home-tab"
                    data-toggle="tab"
                    href="#home"
                    role="tab"
                    aria-controls="home"
                    aria-selected="true"
                  >
                    About
                  </a>
                </li>
                <li class="nav-item"></li>
              </ul>
            </div>
          </div>

        </div>
        <div class="row">
          <div class="col-md-4"></div>
          <div class="col-md-8">
            <div class="tab-content profile-tab" id="myTabContent">
              <div
                class="tab-pane fade show active"
                id="home"
                role="tabpanel"
                aria-labelledby="home-tab"
              >
                <div class="row"></div>
                <div class="row">
                  <div class="col-md-6">
                    <label>Country</label>
                  </div>
                  <div class="col-md-6">
                    <p> {address}</p>
                  </div>
                </div>
                <div class="row">
                  <div class="col-md-6">
                    <label>Email</label>
                  </div>
                  <div class="col-md-6">
                    <p>{email}</p>
                  </div>
                </div>
                <div class="row">
                  <div class="col-md-6">
                    <label>Phone</label>
                  </div>
                  <div class="col-md-6">
                    <p>{phone}</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </form>
    </div>
  );
}

    </div>
    )
  }

  return (

    <Box sx={{ width: '100%' }}>
      <br />
      <br />
      <br />
      <br />
      <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
        <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
          <Tab label="Post" {...a11yProps(0)} />
          <Tab label="About" {...a11yProps(1)} />
          <Tab label="Item Three" {...a11yProps(2)} />
        </Tabs>
      </Box>
      <TabPanel value={value} index={0}>
      </TabPanel>
      <TabPanel value={value} index={1}>
      <About />
      </TabPanel>
      <TabPanel value={value} index={2}>
      </TabPanel>
    </Box>
  );
}
